<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>YouTube Clone</title>
<style>
body {
    font-family: Arial, sans-serif;
    margin: 0;
    padding: 0;
}

header {
    background-color: #fff;
    padding: 1em;
    text-align: center;
}

nav {
    display: flex;
    justify-content: space-between;
    align-items: center;
}

.logo {
    margin-right: 1em;
}

.search-bar {
    flex-grow: 1;
    margin: 0 1em;
}

.search-bar input[type="text"] {
    width: 70%;
    padding: 0.5em;
    border: 1px solid #ccc;
}

.search-bar button {
    padding: 0.5em 1em;
    border: none;
    background-color: #ff0000;
    color: #fff;
    cursor: pointer;
}

.nav-links {
    margin-left: 1em;
}

.nav-links a {
    margin-right: 1em;
    text-decoration: none;
    color: #333;
}

main {
    display: flex;
    flex-direction: column;
    align-items: center;
    padding: 2em;
}

.video-container {
    margin-bottom: 2em;
}

.video-details {
    margin-bottom: 2em;
}

.video-list {
    margin-bottom: 2em;
}

.video-list ul {
    list-style: none;
    padding: 0;
    margin: 0;
}

.video-list li {
    margin-bottom: 1em;
}

.video-list img {
    width: 100px;
    height: 100px;
    object-fit: cover;
    margin-right: 1em;
}

</style>
<script>
    document.querySelector(".search-bar button").addEventListener("click", () => {
    // Get search query
    let query = document.querySelector(".search-bar input[type='text']").value;
    // Perform search action
    console.log(`Searching for ${query}...`);
});

// Add event listener to video thumbnails
document.querySelectorAll(".video-list img").forEach((img) => {
    img.addEventListener("click", () => {
        // Get video ID
        let videoId = img.getAttribute("data-video-id");
        // Play video
        console.log(`Playing video ${videoId}...`);
    });
});



</script>
